import React, { Component } from "react";
import Card from "./card";
import Button from "./button";

class Form extends Component {
  render() {
    return (
      <form className="card">
        <div className="form-group">
          <label htmlFor="fname">First name</label>
        </div>
        <Button name="Button" />
      </form>
    );
  }
}

export default Form;
